    - dbt
    - Member[contracts].Member[graph].Member[semantic_manifest].Member[PydanticSavedQuery]
  - - pydantic.BaseModel~Subclass
    - dbt
    - Member[contracts].Member[graph].Member[semantic_manifest].Member[PydanticSemanticManifest]
